<p>Introducing Margo Middleton, a creative powerhouse both behind the mic and the sketchpad. With an unwavering passion for podcasting and a keen eye for design, typography, and all things visually compelling, Margo effortlessly blends her love for storytelling with her artistic talents.</p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>As a seasoned creator, Margo's authentic voice and insightful commentary resonate deeply with her audience, earning her a devoted following within the creative community.</p>
<!-- /wp:paragraph -->

